import React,{Component} from 'react';
import Map from './Component/Map';
import InfoBox from './Component/InfoBox';
import './App.css';


class App extends Component {

  state = {
  }

  onClick=(e)=>{
    console.log(e);
  }

  render() {

    return(
      <div className="App">
        <Map onHover={this.onClick}/>
        <div className="InfoBox">
          <InfoBox/>
        </div>
      </div>
    );
  }
}



export default App;
